import React, { Component } from "react";
import TestNav from "./components/TopNav";
import BottomNav from "./components/BottomNav";
import "./App.css";
import Goals from "./components/Goals";

import "./components.css";

class PageSettings {
  state = {};
  render() {
    return (
      <div>
        <TestNav></TestNav>

        <div className="body">
        <div className="add-button">
            <Button
              style={{
                fontSize: "15px",
                display: "flex",
              }}
              size="large"
              variant="text"
              color="default"
              startIcon={<AddIcon />}
            >
              {"AddGoal"}
            </Button>
          </div>
        </div>
        <BottomNav></BottomNav>
      </div>
    );
  }
}

export default PageSettings;
